import React from 'react';

const styles = {
    images: {
        height: "150px",
        width: "150px",
      }
  };

function Game (){
        return(
            <main class="container">
                <div role="img" aria-label="click item" class="click-item" style={styles.images}>
                </div>
                <div role="img" aria-label="click item" class="click-item">
                </div>
            </main>
        );
}

export default Game;
